import React from 'react';
import './Services.css'
const Services = () => {
  return (
    <div>
      <h2>Our Services</h2>
      <p>
        In our hospital, we have a team of more than 20 medical staff members
        dedicated to providing the best services. They are available round the
        clock to handle emergency situations. We offer bedside consultations
        with super-specialists in various fields, including pulmonology,
        neurophysiology, neurosurgery, oncology, orthopedics, general surgery,
        gynecology, dentistry, physiotherapy, cardiology, and rheumatology.
      </p>
    </div>
  );
};

export default Services;
